from base64 import b64decode

from Crypto.Cipher import PKCS1_OAEP
from Crypto.PublicKey import RSA

p 
q 

#build a structure (n,e,d,p,q)

rsa_data = (p*q, 65537, pow(65537,-1,(p-1)*(q-1)),p,q)

key = RSA.construct(rsa_data,consistency_check=True)

d = key.d
print(d)

msg = b''
ciphertext= b64decode(msg)
cipher_private = PKCS1_OAEP.new(key)

message_dec = cipher_private.decrypt(ciphertext)

print(message_dec.decode())